import React from 'react';
import './Forum.css';

const PostList = ({ posts }) => {
  return (
    <div className="post-list">
      {posts.map(post => (
        <div className="card" key={post.id}>
          <h3>{post.title}</h3>
          <p>{post.content}</p>
        </div>
      ))}
    </div>
  );
};

export default PostList;
